import React from "react";
import Layout from '../../components/Layout';
import TaskList from '../../components/taskList'
import { CompressContainer } from '../../components/wrappers';
import styled from 'styled-components';

import SkillSet from './skillset';
import Whoami from './whoami';
import ContactMe from './contactme';

const TitleWrapper = styled.p`
    font-size: 36px;
    opacity: 0.5;
    font-family: 'Monoton', cursive;
    text-align: right;
    margin-right: 8px;
    @media (max-width: 767px) {
        margin-right: 0px;
        text-align: center;
    }
`;
const projectsList = [
    {
        title: 'Void Messenger Android appliaction',
        hightLight: 'Void Messenger',
        hexCode: '#EA4C89',
        link: ''
    },
    {
        title: 'Jabbbar Python 3 wrapper for the Dribbble API',
        hightLight: 'Jabbbar',
        hexCode: '#EA4C89',
        link: ''
    },
];
const historyList = [
    {
        title: '2019 / Present - Software Developer - Cuemath - Bengaluru, India',
        hightLight: 'Cuemath',
        hexCode: '#DF5DFF',
        link: 'https://www.cuemath.com'
    },
    {
        title: '2017 - Software Developer Intern - Cuemath - Bengaluru, India',
        hightLight: 'Cuemath',
        hexCode: '#DF5DFF',
        link: 'https://www.cuemath.com',
    }

];
const articlesList = [
    {
        title:     'How to setup a virtual private server from scratch 27 Aug 2018',
        hightLight: '27 Aug 2018',
        hexCode: '#EA4C89',
        link: ''
    },
    {
      title: 'Basic file operations in Python 28 Nov 2017',
      hightLight: '28 Nov 2017',
      hexCode: '#EA4C89',
      link: ''
    },
];

const Index = () => (
    <Layout>
        <CompressContainer>
            {/*<TitleWrapper>NEVER SETTLE</TitleWrapper>*/}
            <Whoami/>
            <SkillSet/>
            <TaskList listHeader="ls projects/" taskList={projectsList} />
            <TaskList listHeader="history" taskList={historyList} />
            <TaskList listHeader="ls articles/" taskList={articlesList} />
            <ContactMe />
        </CompressContainer>
        <TitleWrapper>NEVER SETTLE</TitleWrapper>
    </Layout>
);
export default Index;
